    timer = threading.Timer(.1, Alg_resize)
    timer.start()
    ALGDockWidget.setFloating(True)  #undock
    ALGDockWidget.resize(sizeXmin,sizeYmin)
    ALGDockWidget.activateWindow()
    ALGDockWidget.raise_()
    

    
